-- ----------------------------
--  Table structure for `jia_city`
-- ----------------------------
DROP TABLE IF EXISTS `jia_city`;
CREATE TABLE `jia_city` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `province_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '省',
  `city_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '市',
  `county_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '县',
  `street_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '街道 ',
  `village_id` bigint(20) NOT NULL DEFAULT '0',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '名称',
  `is_child_node` enum('0','1') NOT NULL DEFAULT '1' COMMENT '是否有子节点',
  `status` enum('1','0') DEFAULT '1' COMMENT '0 禁用 1 正常',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=747809 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

